import Vue from 'vue'
import VueRouter from 'vue-router'
import SearchUser from '../components/SearchUser'
import ListUser from '../components/ListUser'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: ListUser

  },
  {
    path: '/SearchUser',
    name: 'about',
    component: SearchUser

  }
]

const router = new VueRouter({
  routes
})

export default router
